# ==========================================
# 3. OPTIMIZED PROCESSING ENGINE
# ==========================================
SUBJECT_MAP = {
    "WAA": "Arabic", "WAC": "Accounting", "WBI": "Biology", "WBS": "Business",
    "WCH": "Chemistry", "WDM": "Decision Maths", "WEC": "Economics", 
    "WEN": "English Lang", "WET": "English Lit", "WFM": "Further Pure Maths", 
    "WFR": "French", "WGE": "Geography", "WGK": "Greek", "WGN": "German", 
    "WHI": "History", "WIT": "IT", "WMA": "Pure Mathematics", 
    "WME": "Mechanics", "WPH": "Physics", "WPS": "Psychology", 
    "WSP": "Spanish", "WST": "Statistics", "YLA": "Law"
}

MONTH_ORDER = {"January": 1, "June": 2, "Summer": 2, "October": 3, "November": 3, "Autumn": 3, "Unknown": 4}

@st.cache_data(show_spinner=False)
def load_and_process_data(csv_string):
    try:
        if not csv_string or "PASTE ABOVE THIS LINE" in csv_string:
             try:
                 df = pd.read_csv('ial_question_papers.csv')
             except:
                 return None
        else:
            df = pd.read_csv(io.StringIO(csv_string))
            
    except Exception as e:
        st.error(f"Error parsing CSV data: {e}")
        return None

    # --- VECTORIZED PROCESSING ---
    if 'URL' in df.columns:
        df = df[~df['URL'].str.contains('/secure/', case=False, na=False)]

    df['Year_Str'] = df['Title'].astype(str).str.extract(r'(20[0-5][0-9])').fillna("Unknown")
    df['Year_Num'] = pd.to_numeric(df['Year_Str'], errors='coerce')

    title_lower = df['Title'].str.lower()
    
    cond_session = [
        title_lower.str.contains('january', na=False),
        title_lower.str.contains('june|summer', na=False),
        title_lower.str.contains('october|november|autumn', na=False)
    ]
    choices_session = ['January', 'June', 'October']
    df['Session'] = np.select(cond_session, choices_session, default='Unknown')

    cond_type = [
        title_lower.str.contains('mark scheme|rms', na=False),
        title_lower.str.contains('examiner report|pef', na=False),
        title_lower.str.contains('question paper|que|qp', na=False)
    ]
    choices_type = ['Mark Scheme', 'Examiner Report', 'Question Paper']
    df['Type'] = np.select(cond_type, choices_type, default='Other')

    df['Subject'] = df['Unit_Code'].astype(str).str[:3].map(SUBJECT_MAP).fillna("Other")

    df['Search_Context'] = (
        df['Title'].astype(str) + " " + 
        df['Unit_Code'].astype(str) + " " + 
        df['Subject'].astype(str) + " " + 
        df['Year_Str'].astype(str) + " " + 
        df['Session'].astype(str)
    ).str.lower()

    df['Month_Num'] = df['Session'].map(MONTH_ORDER)
    df.sort_values(
        by=['Year_Num', 'Month_Num', 'Subject', 'Type'], 
        ascending=[False, True, True, True],
        inplace=True
    )
    
    return df

# ==========================================
# 4. JS INJECTION FOR DRAG SCROLLING
# ==========================================
def inject_drag_scroll():
    # This JS script finds the table container and enables "Drag to Scroll"
    js = """
    <script>
        function enableDragScroll() {
            // Target the specific Streamlit dataframe scroll container
            const targets = window.parent.document.querySelectorAll('[data-testid="stDataFrame"] > div');
            
            targets.forEach(slider => {
                let isDown = false;
                let startX;
                let scrollLeft;
                let startY;
                let scrollTop;

                slider.addEventListener('mousedown', (e) => {
                    isDown = true;
                    slider.classList.add('active');
                    startX = e.pageX - slider.offsetLeft;
                    scrollLeft = slider.scrollLeft;
                    startY = e.pageY - slider.offsetTop;
                    scrollTop = slider.scrollTop;
                });

                slider.addEventListener('mouseleave', () => {
                    isDown = false;
                    slider.classList.remove('active');
                });

                slider.addEventListener('mouseup', () => {
                    isDown = false;
                    slider.classList.remove('active');
                });

                slider.addEventListener('mousemove', (e) => {
                    if(!isDown) return;
                    e.preventDefault();
                    const x = e.pageX - slider.offsetLeft;
                    const walkX = (x - startX) * 2; // Scroll-fastness horizontal
                    slider.scrollLeft = scrollLeft - walkX;
                    
                    const y = e.pageY - slider.offsetTop;
                    const walkY = (y - startY) * 2; // Scroll-fastness vertical
                    slider.scrollTop = scrollTop - walkY;
                });
            });
        }
        // Run it immediately and also whenever Streamlit re-renders
        enableDragScroll();
        setTimeout(enableDragScroll, 1000); // Failsafe retry
    </script>
    """
    components.html(js, height=0, width=0)

