# ==========================================
def main():
    col1, col2 = st.columns([3, 1])
    with col1:
        st.title(" IAL Paper Browser")
        st.markdown("Access IAL papers. **Drag table to scroll.**")
    
    df = load_and_process_data(CSV_DATA)
    
    if df is None:
        st.warning(" No data found. Please paste your CSV content into the `CSV_DATA` variable.")
        return

    # --- SIDEBAR FILTERS ---
    with st.sidebar:
        st.header(" Filters")
        
        # 1. Document Type
        show_qp = st.checkbox("Question Papers", value=True)
        show_ms = st.checkbox("Mark Schemes", value=False)
        show_er = st.checkbox("Examiner Reports", value=False)
        show_ot = st.checkbox("Other", value=False)
        
        selected_types = []
        if show_qp: selected_types.append("Question Paper")
        if show_ms: selected_types.append("Mark Scheme")
        if show_er: selected_types.append("Examiner Report")
        if show_ot: selected_types.append("Other") 

        st.divider()

        # 3. Year Filter
        valid_years = df['Year_Num'].dropna()
        if not valid_years.empty:
            min_y, max_y = int(valid_years.min()), int(valid_years.max())
            selected_years = st.slider("Year Range", min_y, max_y, (min_y, max_y))
        else:
            selected_years = (2010, 2030)

        # 4. Session Filter
        all_sessions = ["January", "June", "October"]
        selected_sessions = st.multiselect("Session", all_sessions, default=all_sessions)

    # --- APPLYING FILTERS ---
    mask = (
        df['Type'].isin(selected_types) &  
        df['Session'].isin(selected_sessions) &
        (df['Year_Num'] >= selected_years[0]) & 
        (df['Year_Num'] <= selected_years[1])
    )
    filtered_df = df[mask]

    # --- SMART SEARCH BAR ---
    search_query = st.text_input(" Search (e.g., 'Jan 2024 PH11')", placeholder="Type keywords...")
    
    if search_query:
        keywords = search_query.lower().split()
        for term in keywords:
            filtered_df = filtered_df[filtered_df['Search_Context'].str.contains(term, na=False)]

    # --- METRICS ---
    m1, m2, m3, m4 = st.columns(4)
    m1.metric("Visible Files", len(filtered_df))
    m2.metric("Unique Units", filtered_df['Unit_Code'].nunique())
    
    if not filtered_df.empty and filtered_df['Year_Num'].notna().any():
        min_y = int(filtered_df['Year_Num'].min())
        max_y = int(filtered_df['Year_Num'].max())
        range_str = f"{min_y} - {max_y}" if min_y != max_y else f"{min_y}"
        m3.metric("Year Range", range_str)
    else:
        m3.metric("Year Range", "N/A")

    # M4: Hidden by Filters
    total_files = len(df)
    hidden_files = total_files - len(filtered_df) - 50 
    m4.metric("Hidden by Filters", hidden_files)

    st.divider()

    # --- DISPLAY TABLE ---
    display_cols = ['Year_Str', 'Session', 'Subject', 'Unit_Code', 'Type', 'Title', 'URL']
    
    st.dataframe(
        filtered_df[display_cols],
        column_config={
            "URL": st.column_config.LinkColumn("Download", display_text="Open PDF"),
            "Year_Str": st.column_config.TextColumn("Year", width="small"),
            "Session": st.column_config.TextColumn("Session", width="small"),
            "Subject": st.column_config.TextColumn("Subject", width="medium"),
            "Unit_Code": st.column_config.TextColumn("Code", width="small"),
            "Type": st.column_config.TextColumn("Type", width="medium"),
            "Title": st.column_config.TextColumn("Full Title", width="large"),
        },
        hide_index=True,
        use_container_width=True,
        height=800
    )
    
    # Inject the Drag Logic at the end
    inject_drag_scroll()

if __name__ == "__main__":
    main()